// src/components/FloatingIcons.js
import React from 'react';
import './FloatingIcons.css';

const FloatingIcons = () => {
    return (
        <div className="floating-icons">
            {[...Array(7)].map((_, i) => (
                <div key={i} style={{ animationDuration: `${5 + i}s` }} className="icon"></div>
            ))}
        </div>
    );
};

export default FloatingIcons;
